import React from "react";
import Crossword from "@jaredreisinger/react-crossword";
import styled from "styled-components";

const data = {
  across: {
    1: {
      clue: "one plus one",
      answer: "TWO",
      row: 0,
      col: 0,
    },
  },
  down: {
    2: {
      clue: "three minus two",
      answer: "ONE",
      row: 0,
      col: 2,
    },
  },
};

const CrosswordContainer = styled.div`
  width: 500px; /* Adjust the width to make the crossword smaller */
  margin: auto; /* Center the crossword */
  border: 2px solid #333; /* Add a border around the crossword */
  padding: 10px; /* Add some padding */
  background-color: #f9f9f9; /* Background color of the container */
  box-shadow: 0px 0px 10px rgba(0, 0, 0, 0.1); /* Add a subtle shadow */
`;

export default function UtakAtikGathukNglegena() {
  const customTheme = {
    gridBackground: "#f9f9f9", // Background color of the crossword grid
    cellBackground: "#ffffff", // Background color of each cell
    cellBorder: "#000000", // Border color of each cell
    textColor: "#000000", // Text color of the answers
  };

  return (
    <CrosswordContainer>
      <br />
      <h1 className="text-center">Kuis</h1>
      <br />
      <Crossword data={data} theme={customTheme} />
    </CrosswordContainer>
  );
}
